import React from 'react';
import PostList from '../components/Post/PostList';
import Navbar from '../components/Navbar';
import { Box, Typography } from '@mui/material'; // Add this import

const Home = () => {
  return (
    <>
      <Navbar />
      <Box p={3}>
        <Typography variant="h4" gutterBottom>
          Welcome to My Blog
        </Typography>
        <PostList />
      </Box>
    </>
  );
};

export default Home;
